import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <svg width={300} height={400}>
        <line x1='100' y1='100' x2='10' y2='25' stroke='grey'></line>
      </svg>
    </div>
  );
}

export default App;
